import React from 'react';
import TaskItem from './TaskItem';

const TaskList = ({ tasks, onDelete, onToggleComplete }) => { // Receive onToggleComplete prop
  return (
    <div>
      <h2 className="text-2xl font-bold mb-4">Task List</h2>
      {tasks.map(task => (
        <TaskItem
          key={task._id}
          task={task}
          onDelete={onDelete}
          onToggleComplete={onToggleComplete} // Pass onToggleComplete to TaskItem
        />
      ))}
    </div>
  );
};

export default TaskList;
